  this.show_hide = function(element, type) {
    if (type === 'open') {
      $('.numeric-answers').css('display', 'none');
      return $('.open-answers').css('display', 'block');
    } else if (type === 'scalar') {
      $('.numeric-answers').css('display', 'block');
      return $('.open-answers').css('display', 'none');
    } else if (type === 'yes-no') {
      $('.numeric-answers').css('display', 'none');
      return $('.open-answers').css('display', 'none');
    }
  };

  this.assign_to_hidden = function(element, type) {
    if (type === 'from') {
      return $('#scalar_from_val').val($('#scalar_from').val());
    } else if (type === 'to') {
      return $('#scalar_to_val').val($('#scalar_to').val());
    } else {
      return $('#open_answer_val').val($('#open-answers').val());
    }
  };

  this.animate = function(bar, type, user) {
    switch (type) {
      case 0:
        return bar.animate(user.diet_score / 100);
      case 1:
        return bar.animate(user.physical_score / 100);
      default:
        return bar.animate(user.mental_score / 100);
    }
  };

  this.get_labels_name = function(type) {
    switch (type) {
      case 0:
        return ['<i class="material-icons md-36">room_service</i>', 'diet'];
      case 1:
        return ['<i class="material-icons md-36">directions_bike</i>', 'physical'];
      default:
        return ['<i class="material-icons md-36">local_florist</i>', 'mental'];
    }
  };

  this.score = function(user, type) {
    var bar, labels;
    labels = get_labels_name(type);
    bar = new ProgressBar.Circle("#" + labels[1] + "_score_" + user.id, {
      strokeWidth: 10,
      color: '#FF0000',
      trailColor: '#4cc7dd',
      trailWidth: 10,
      easing: 'easeInOut',
      duration: 1400,
      svgStyle: null,
      text: {
        value: labels[0],
        alignToBottom: false,
        style: {
          color: '#000000',
          position: 'relative',
          left: '0',
          top: '-72%',
          padding: 0,
          margin: 0
        }
      },
      from: {
        color: '#FF0000'
      },
      to: {
        color: '#008000'
      },
      step: function(state, semicircle, attachment) {
        return semicircle.path.setAttribute('stroke', state.color);
      },
      autoStyleContainer: false
    });
    bar.text.style.fontFamily = '"Raleway", Helvetica, sans-serif';
    bar.text.style.fontSize = '15px';
    bar.text = labels[0];
    return animate(bar, type, user);
  };

  this.add_image_tag = function(user) {
    var div, div_id;
    div_id = "profile-img-user-" + user.id;
    div = $("#" + div_id);
    return div.prepend('<img class="user-img-round" src="' + user.profile_img + '" />');
  };

  this.getScores = function() {
    return $.ajax("/users/get_scores", {
      type: 'GET',
      dataType: 'json',
      json: true,
      success: function(data, textStatus, jqXHR) {
        var j, len, ref, results, user;
        ref = data.users;
        results = [];
        for (j = 0, len = ref.length; j < len; j++) {
          user = ref[j];
          if ($("#physical_score_" + user.id).length > 0) {
            score(user, 0);
            score(user, 1);
            results.push(score(user, 2));
          } else {
            results.push(void 0);
          }
        }
        return results;
      }
    });
  };

  this.getImages = function() {
    return $.ajax("/users/get_images", {
      type: 'GET',
      dataType: 'json',
      json: true,
      success: function(data, textStatus, jqXHR) {
        var j, len, ref, results, user;
        ref = data.users;
        results = [];
        for (j = 0, len = ref.length; j < len; j++) {
          user = ref[j];
          results.push(add_image_tag(user));
        }
        return results;
      }
    });
  };

  this.addTips = function() {
    Tipped.create('.chat-with-user', 'Chatta con il Paziente');
    return Tipped.create('.archive-user', 'Archivia il Paziente');
  };

